(1, 1, 'Poppy Frosted Salmon','$5.95', 'Huge coral-salmon blooms look just like pom-poms! When buds crack open, they reveal a white base, and petal tips are lightly frosted.', 'https://shop.floretflowers.com/cdn/shop/products/FrostedSalmonPeony3-2_768x.jpg?v=1623875544', 'True', '2022-01-09 00:05:01');
INSERT INTO products
