(6, 6,'Sweet Pea Carlotta','$5.95', 'Bred by Carters, this beautiful old fashioned variety has stood the test of time. Its saturated carmine-pink blooms stand out in the garden and the vase.', 'https://shop.floretflowers.com/cdn/shop/products/Sweet_Pea_Carlotta_Floret-1_768x.jpg?v=1569010798', 'True', '2021-01-09 10:05:01');
