(10, 10,'Bells of Ireland','$7.95', 'A cutting garden staple and one of the finest annual foliage plants you can grow for mixed bouquets. Plants are heavily branched, producing a bumper crop of tall, lime green spires adorned with bell shaped blooms.', 'https://shop.floretflowers.com/cdn/shop/products/Bells_Of_Ireland_Floret_768x.jpg?v=1623872031', 'True', '2022-01-09 00:05:15);
